// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";
import "./interfaces/IPriceOracle.sol";

contract PriceOracle is IPriceOracle, Initializable, AccessControlUpgradeable {
    bytes32 public constant PRICE_UPDATER = keccak256("PRICE_UPDATER");

    bool private priceSet;
    uint256 private currentPrice_;

    function initialize() public initializer {
        __AccessControl_init();

        _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());
        _setupRole(PRICE_UPDATER, _msgSender());

        priceSet = false;
        currentPrice_ = 0;
    }

    /// Price CRUD
    function currentPrice() external view override returns (uint256) {
        require(priceSet, "ERR01");
        return currentPrice_;
    }

    function setCurrentPrice(uint256 _currentPrice) external override {
        require(hasRole(PRICE_UPDATER, _msgSender()), "ERR02");
        require(_currentPrice > 0, "ERR03");

        priceSet = true;
        currentPrice_ = _currentPrice;

        emit CurrentPriceUpdated(_currentPrice);
    }
}
